 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "Kuigi tihedamini kasutuses formaalsetes testi \nolukordades, v\u00f5ib MCQ-sid kasutada kui testimisvahendit m\u00f5tete \/ vestluste \nstimuleerimiseks teemadel, mille v\u00e4ljendamisel v\u00f5i \u00f5pilane olla tagasihoidlik. \n\nMCQ-testi disainimisel pea meeles j\u00e4rgmist:\n<ul>\n<li> Mis on \u00f5ppe tulemused, millised on k\u00fcsimuste testimisomadused<\/li>\n<li> Milliseid intellektuaalseid v\u00f5imeid testitakse<\/li>\n<li> Milline on sihtgrupi keeleoskused<\/li>\n<li> Soolised ja kultuurilised probleemid<\/li>\n<li> V\u00e4ldi grammatilisi ja k\u00fcsimuste struktuure, mis v\u00f5iksid vihjeid anda<\/li>\n<\/ul>\n ", 
