 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nTeksti iDevice-ga kaasa olevat pilti v\u00f5ib kasutada mitmel viisil, toetamaks\nnii eXe sisu emotsionaalset kui ka kognitiivset dimensiooni.<\/p><p>\n<b>Visuaalse ja suulise info integreerimine<\/b>\n<\/p><p>\nKognitiivps\u00fchholoogid on v\u00e4lja pakkunud, et esitades \u00f5pilasele koos pildiga \nka tekstip\u00f5hise kokkuv\u00f5tte pildil olevast n\u00e4htusest, v\u00e4hendab kognitiivset \nkoormust ja parandab \u00f5pitu meelespidamist. \nSeda iDevice-i v\u00f5ib kasutada pildi (foto, diagrammi, graafiku) esitamisel\nkoos l\u00fchikese kokkuv\u00f5ttega, mis kataks n\u00e4idatud pildi p\u00f5hipunkte.\nN\u00e4iteks, \u00f5petades 4-taktilise mootori toimimisp\u00f5him\u00f5tteid, v\u00f5iks olla \nkolvi iga 4 asendi kohta \u00fcks pilt koos p\u00f5him\u00f5tete l\u00fchikirjeldusega.\n<\/p>", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>\"T\u00e4ida l\u00fcngad\"-testid v\u00f5i \u00fclesanded on tekstid v\u00f5i laused kust on kustutatud m\u00f5ned s\u00f5nad v\u00f5i fraasid. Neid kasutatakse tihti j\u00e4rgmistel puhkudel:<\/p><ol><li>Kontrollimaks teadmisi kursuse p\u00f5him\u00f5istete kohta (see peaks olema kursusele eelnev test, \u00fclesanne v\u00f5i kokkuv\u00f5ttev kontroll).<\/li><li>Kontrollimaks loetust arusaamist.<\/li><li>Kontrollimaks s\u00f5nade t\u00e4henduste tundmist.<\/li><li>Kontrollimaks lausete-s\u00f5nade moodustamist ja\/v\u00f5i grammatika tundmist.<\/li><\/ol>", 
