 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitilization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Kui j\u00e4tta see valimata, aktsepteeritakse v\u00e4ikest hulka \u00f5igekirja ja suur\/v\u00e4ike-t\u00e4htede vigu. Kui on valitud, ei aktsepteerita \u00fchtegi viga.<\/p><p><strong>N\u00e4iteks:<\/strong> Kui \u00f5ige vastus on <code>Elevant<\/code> siis nii <code>elevant<\/code> kui ka <code>elivant<\/code> loetakse algoritmi poolt <em>\"piisavalt \u00f5igeks\"<\/em>, kuna ainult \u00fcks t\u00e4ht on valesti, isegi siis kui \"Kontrolli suuri-v\u00e4ikseid t\u00e4hti\" on valitus.<\/p><p>Kui suurte\/v\u00e4ike-t\u00e4htede kontrollimine ei ole aktiivne, ei peeta v\u00e4iket\u00e4ht <code>e<\/code> veaks ja ka <code>elivant<\/code> on aktsepteeritud.<\/p><p>Kui nii \"Kindel m\u00e4rkimine\" kui ka \"Kontrolli suuri-v\u00e4ikseid t\u00e4hti\" on valitud, on ainuke \u00f5ige vastus \"Elevant\". Kui ainult \"Kindel m\u00e4rkimine\" on valitud ja \"Kontrolli suuri-v\u00e4ikseid t\u00e4hti\" mitte, siis loetakse ka \"elevant\" \u00f5igeks.<\/p>", 
