 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU free documentation license.<\/p>": "<p>Wikipedia iDevice lubab sul leida \nWikipedias olevat sisumaterjali ja laadida se alla sinu eXe ressurssi. \n Wikipedia Artikli iDevice teeb koopia artikli sisust. \nUuendused Wikipedia lehel ei uuene automaatselt eXe-s asuvates koopiates, seega peab artiklist tegema uue koopia.\n Sarnaselt ei uuenda ka eXe-s tehtud muudatused Wikipedia lehel asuvat artiklit.<\/p> <p>Wikipedia sisu on kaitstud <i>GNU free documentation<\/i> litsentsiga.<\/p>", 
