 "When building an MCQ consider the following: <ul>\n<li> Use phrases that learners are familiar with and have \nencountered in their study <\/li>\n<li> Keep responses concise <\/li>\n<li> There should be some consistency between the stem and the responses <\/li>\n<li> Provide enough options to challenge learners to think about their response\n<\/li>\n<li> Try to make sure that correct responses are not more detailed than the \ndistractors <\/li>\n<li> Distractors should be incorrect but plausible <\/li>\n<\/ul>\n": "MCQ-testi koostamisel pea meeles j\u00e4rgmist: <ul>\n<li> Keeleliselt kasuta fraase millega \u00f5pilased on eelnevas \u00f5ppes kokku puutunud<\/li>\n<li> Hoia vastused l\u00fchidad<\/li>\n<li> T\u00fcve ja vastuste vahele peaks eksisteerima teatud j\u00e4rjepidevus<\/li>\n<li> Paku v\u00e4lja piisavalt valikuvariante, sundimaks \u00f5pilasi oma vastuse \u00fcle j\u00e4rele m\u00f5tlema<\/li>\n<li> Hoia nii \u00f5iged kui ka valed ehk segavad vastused samal detailsuse astmel<\/li>\n<li> Segavad vastused peaksid olema v\u00e4\u00e4rad kuid m\u00f5eldavad<\/li>\n<\/ul>\n", 
