 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>\tWhat educational points are conveyed in the story<\/li>\n<li>\tWhat preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>\tWhere the case study fits into the rest of the course<\/li>\n<li>\tHow the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Juhtumi kirjeldus on lugu, mis kannab endas \nharivat informatsiooni. Juhtumi kirjeldust v\u00f5ib kasutada esitamaks realistlikku \nsituatsiooni, mis lubab \u00f5pilastel rakendada oma teadmisi ja kogemusi. Juhtumi \nkirjelduse disainimisel peaks meeles pidama j\u00e4rgmist:<ul> \n<li>\tMillist harivat infot see edasi annab<\/li>\n<li>\tMilline peaks olema \u00f5pilaste eelnev ettevalmistus selle juhtumi kirjeldusega t\u00f6\u00f6tamiseks<\/li>\n<li>\tKuidas see juhtumi kirjeldus sobib \u00fclej\u00e4\u00e4nud kursusesse<\/li>\n<li>\tKuidas \u00f5pilased suhtlevad \u00f5ppematerjalidega ja \u00fcksteisega, nt. kas klassiruumi puhul on v\u00f5imalik gruppides t\u00f6\u00f6tada juhtumi erinevate aspektide kallal, ja kui on, siis kuidas on korraldatud ideede tagasisidestus klassile<\/li><\/ul>", 
