 "Aymara ": "Aymara", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Kui sinu eesm\u00e4rgiks on testida loetud materjali p\u00f5him\u00f5istetest arusaamine<\/dt>  <dd>    <p> Kirjuta kokkuv\u00f5te tekstist v\u00f5i m\u00f5istest. See peaks olema piisavalt pikk, et testida antud info omandamist, kuid samas piisavalt l\u00fchike, et ei oleks koormav. Kuni \u00fcks tr\u00fckitud lehek\u00fclg peaks olema piisav, kuid noorematele ja algajatele \u00f5pilastele v\u00f5iks olla tunduvalt l\u00fchem.<\/p>    <p>Vali tekstist v\u00f5tmes\u00f5nad, mis m\u00e4rgivad m\u00f5istetest arusaamist. Need on t\u00f5en\u00e4oliselt tegu-. nimi- ja m\u00e4\u00e4rs\u00f5nad. Vali alternatiivid, millele oleks \u00fcks selge vastus.<\/p>  <\/dd>  <dt>Kui sinu eesm\u00e4rgiks on testida s\u00f5nade tundmist:<\/dt>  <dd><p>Kirjuta tekst, mis sisaldaks vastavaid s\u00f5nu. See tekst peaks olema arusaadav ja seotud ning ka siinkohal p\u00f6\u00f6ra t\u00e4helepanu teksti pikkusele. M\u00e4rgista tekstis v\u00f5tmes\u00f5nad. Vali alternatiivid, millele oleks \u00fcks selge vastus.<\/p><\/dd>  <dt>Kui sinu eesm\u00e4rgiks on testida lausete moodustamine ja grammatikat: <\/dt>  <dd>  <p>Kasuta tekstis soovitud lausevorme. See tekst peaks olema arusaadav ja seotud ning ka siinkohal p\u00f6\u00f6ra t\u00e4helepanu teksti pikkusele. Pea meeles, et eesm\u00e4rgiks ei ole s\u00f5nade tundmine, nii et kasutatud s\u00f5nade t\u00e4hendused peavad olema \u00f5pilastele h\u00e4sti teada.<\/p>  <p>M\u00e4rgista tekstis v\u00f5tmes\u00f5nad. Paku v\u00e4lja alternatiive samade s\u00f5nat\u00fcvedega, kuid teistes k\u00e4\u00e4netes\/p\u00f6\u00f6retes. Hea m\u00f5te on lasta kolleegil eelnevalt koostatud testi v\u00f5i \u00fclesannet lahendada\/kontrollida, et v\u00e4ltida \u00fcllatusi !<\/p><\/dd><\/dl>", 
